if (typeof jQuery == "undefined") {throw new Error("Documentation needs the jQuery library to function.")};
$('body').scrollspy({
    target: '#my-nav',
    offset: 20
});
var bs = $('.footer').outerHeight()+10;
$("#my-nav").sticky({topSpacing:20, bottomSpacing: bs});
$("span.version").html(version || "");
$(document).ready(function () {
    prettyPrint();
    setTimeout(function(){
        return;
        $.confirm({
            title: 'Ahh, ad blockers',
            icon: 'fa fa-meh-o',
            content: "Ads aren't what you're here for. But ads help me support my work. So, please consider to add this domain to your blocker's whitelist. <br>I'd really appreciate it.",
            closeIcon: false,
            buttons: {
                dontCare: {
                    text: 'I dont care &gt;:(',
                }
            }
        })
    }, 1000)
});
function rs(){
    if($(window).width() > 992){
        $('#my-nav').show();
    }else{
        $('#my-nav').hide();
    }
}
$(window).resize(function(){
    rs();
})
rs();
